import React from 'react'

function Home() {
    const [movies, setMovies] = useState([]);

  useEffect(() => {
    axios.get(API_URL)
      .then(res => {
        console.log(res.data.results)
        setMovies(res.data.results)
      })
      .catch(err => {
        console.log(err)
      })
  }, []);
  
    return (
        <div>
            <h2>Home</h2>

            {movies ?
            <MovieList movies={movies}></MovieList>
             : <p>No movies</p>}
        </div>
    )
}

export default Home
